.loadTxcss {
	padding-top: 150px;
}

.loadList {
	position: fixed !important;
	top: 95px;
	width: 100%;
	z-index: 4;
}

.loadingText {
	font-size: 15px;
	text-align: center;
	line-height: 30px;
	opacity: 0.9;
	transform: scale(1);
	padding-top: 10px;
}

.step2 {
	color: #fb131e;
	animation: big 1s infinite;
}

@keyframes big {
	0 {

		transform: scale(1);
	}

	50% {

		transform: scale(1.2);
	}

	100% {

		transform: scale(1);
	}
}

.alert {
	position: fixed;
	width: 100%;
	height: 100%;
	background: rgba(0, 0, 0, 0.6);
	z-index: 6;
	left: 0;
	top: 0;
	margin: auto;

	img {
		width: 200px;
		position: fixed;
		height: 150px;
		z-index: 7;
		left: 0;
		top: 0;
		margin: auto;
		right: 0;
		bottom: 0
	}
}

.loading {
	width: 90%;
	height: 45px;
	background-size: 100% 100%;
	margin: 10px 5% 10px 5%;
	position: relative;

	.index {
		width: 0%;
		position: absolute;
		height: 17px;
		top: 14px;
		background: #2880e8;
		left: 1%;
		border-radius: 20px 0px 0px 20px;
		transition: 5s linear;
	}


	.redBag {
		width: 38px;
		position: absolute;
		right: 0;
		bottom: 5px
	}

	.gif {
		bottom: 50px;
		width: 40px;
		position: absolute;
		right: -10px;

	}

	.qipao {
		animation: gif 1s infinite;
	}


}

@keyframes gif {
	0 {
		bottom: 50px
	}

	50% {
		bottom: 55px;
	}

	100% {
		bottom: 50px
	}
}

ul {
	list-style-type: none;
	padding: 0;
	margin: 0;
}

li {
	display: inline-block;
	margin: 0 10px;
}

a {
	color: #000;
}

.item {
	width: 92%;
	overflow: hidden;
	margin: 0 auto;
	position: relative;
	display: block;
	border-bottom: 1px solid #eeeeee;
	padding: 12px 0;
}

.ex1-left {
	width: 63%;
	float: left;
	display: flex;
	flex-wrap: wrap;
	align-content: space-between
}

.categoryName {
	color: #f94d17;
	border: 1px solid #f94d17;
	font-size: 10px;
	text-align: center;
	display: inline-block;
	padding: 0px 4px;
}

.ex1-img {
	overflow: hidden;
	width: 34%;
	height: 21.3vw;
	float: right;

	.ex-img {
		min-height: 21.3vw;
		background-size: 64px;
		background-color: #F5F5F5;
		display: block;
		width: 100%;
	}
}

.ex-title {
	font-size: 15px;
}

.ex1 {
	.ex-title {
		display: -webkit-box;
		overflow: hidden;
		width: 100%;
		text-overflow: ellipsis;
		-webkit-line-clamp: 2;
		-webkit-box-orient: vertical
	}
}

.ex2 {
	.ex-title {
		padding-bottom: 7px;
		display: block;
		position: relative;

	}

}

.ex2-img {
	height: 21.3vw;
	overflow: hidden;
	display: flex;
	justify-content: space-between;

	.ex-img {
		display: block;
		width: 32%;
		min-height: 100%;
	}
}

.nav-list {
	overflow: hidden;
	overflow-x: scroll;
	white-space: nowrap;
	display: flex;
	height: 56px;
	align-items: center;
	position: relative;
	background-color: #4396f7;
	height: 56px;
}

.nav-a {
	color: rgba(255, 255, 255, .7);
	text-decoration: none;
	font-size: 16px;
	margin: 0px;
	padding: 0 10px;
	line-height: 28px;
	display: inline-block;
	height: 28px;
	position: relative;
}

.selected {
	font-weight: bold;
	color: #fff;
}

.selected .underLine {
	width: 15px;
	height: 1px;
	background: #FFF;
	bottom: 0px;
	left: 0px;
	right: 0px;
	margin: auto;
}
